import styled from "styled-components";

export const SliderContainer = styled.div`
    display: flex;
    flex-direction: column;
    position: fixed;
    bottom: 40px;
    right: 60px;
`

export const SliderToggle = styled.img`
    width: 50px;
    curdor: pointer;
    filter: drop-shadow(0px 5px 2px #4444dd);
`
